import React, { useState } from "react";
import { Box, Button, Typography, Grid } from "@mui/material";

const DMMSearch = ({ setSearchParams }) => {
  const [keyword, setKeyword] = useState("");

  // üîπ ÂêÑ„Ç´„ÉÜ„Ç¥„É™„ÅÆÈÅ∏ÊäûÁä∂ÊÖã
  const [bust, setBust] = useState("");
  const [birth, setBirth] = useState("");
  const [height, setHeight] = useState("");

  // üîç Ê§úÁ¥¢„Éú„Çø„É≥„ÅåÊäº„Åï„Çå„Åü„Å®„Åç„ÅÆÂá¶ÁêÜ
  const handleSearch = () => {
    const params = { keyword };

    // üîπ „Éê„Çπ„Éà„Çµ„Ç§„Ç∫„Çí DMM API „ÅÆ„É™„ÇØ„Ç®„Çπ„ÉàÂΩ¢Âºè„Å´Â§âÊèõ
    if (bust === "small") {
      params["gte_bust"] = "0";
      params["lte_bust"] = "80";
    } else if (bust === "medium") {
      params["gte_bust"] = "80";
      params["lte_bust"] = "90";
    } else if (bust === "large") {
      params["gte_bust"] = "90";
    }

    // üîπ ÁîüÂπ¥ÊúàÊó•„Çí DMM API „ÅÆ„É™„ÇØ„Ç®„Çπ„ÉàÂΩ¢Âºè„Å´Â§âÊèõ
    if (birth === "young") {
      params["gte_birthday"] = "2003";
    } else if (birth === "normal") {
      params["gte_birthday"] = "1995";
      params["lte_birthday"] = "2002";
    } else if (birth === "old") {
      params["lte_birthday"] = "1994";
    }

    // üîπ Ë∫´Èï∑„Çí DMM API „ÅÆ„É™„ÇØ„Ç®„Çπ„ÉàÂΩ¢Âºè„Å´Â§âÊèõ
    if (height === "small") {
      params["gte_height"] = "0";
      params["lte_height"] = "155";
    } else if (height === "medium") {
      params["gte_height"] = "155";
      params["lte_height"] = "165";
    } else if (height === "tall") {
      params["gte_height"] = "165";
    }

    setSearchParams(params);
  };

  return (
    <Box sx={{ textAlign: "center", padding: 3 }}>
      <Typography variant="h5" sx={{ marginBottom: 2 }}>
        Ê§úÁ¥¢Êù°‰ª∂„ÇíÈÅ∏Êäû
      </Typography>

      {/* üîπ „Ç≠„Éº„ÉØ„Éº„ÉâÂÖ•Âäõ */}
      <input
        type="text"
        placeholder="„Ç≠„Éº„ÉØ„Éº„Éâ„ÇíÂÖ•Âäõ"
        value={keyword}
        onChange={(e) => setKeyword(e.target.value)}
        style={{
          padding: "10px",
          width: "80%",
          marginBottom: "20px",
          borderRadius: "5px",
          border: "1px solid #ccc",
        }}
      />

      {/* üîπ „Éê„Çπ„Éà„Çµ„Ç§„Ç∫ÈÅ∏Êäû */}
      <Typography variant="h6">„Éê„Çπ„Éà„Çµ„Ç§„Ç∫</Typography>
      <Grid container spacing={2} justifyContent="center">
        {[
          { label: "Â∞è (~80cm)", value: "small" },
          { label: "‰∏≠ (80~90cm)", value: "medium" },
          { label: "Â§ß (90cm~)", value: "large" },
        ].map((option) => (
          <Grid item key={option.value}>
            <Button
              variant={bust === option.value ? "contained" : "outlined"}
              color="primary"
              onClick={() => setBust(option.value)}
            >
              {option.label}
            </Button>
          </Grid>
        ))}
      </Grid>

      {/* üîπ ÁîüÂπ¥ÊúàÊó•ÈÅ∏Êäû */}
      <Typography variant="h6" sx={{ marginTop: 2 }}>Âπ¥ÈΩ¢</Typography>
      <Grid container spacing={2} justifyContent="center">
        {[
          { label: "22Ê≠≥‰ª•‰∏ã", value: "young" },
          { label: "23~30Ê≠≥", value: "normal" },
          { label: "30Ê≠≥‰ª•‰∏ä", value: "old" },
        ].map((option) => (
          <Grid item key={option.value}>
            <Button
              variant={birth === option.value ? "contained" : "outlined"}
              color="secondary"
              onClick={() => setBirth(option.value)}
            >
              {option.label}
            </Button>
          </Grid>
        ))}
      </Grid>

      {/* üîπ Ë∫´Èï∑ÈÅ∏Êäû */}
      <Typography variant="h6" sx={{ marginTop: 2 }}>Ë∫´Èï∑</Typography>
      <Grid container spacing={2} justifyContent="center">
        {[
          { label: "Â∞è (~155cm)", value: "small" },
          { label: "‰∏≠ (155~165cm)", value: "medium" },
          { label: "È´ò (165cm~)", value: "tall" },
        ].map((option) => (
          <Grid item key={option.value}>
            <Button
              variant={height === option.value ? "contained" : "outlined"}
              color="success"
              onClick={() => setHeight(option.value)}
            >
              {option.label}
            </Button>
          </Grid>
        ))}
      </Grid>

      {/* üîç Ê§úÁ¥¢„Éú„Çø„É≥ */}
      <Box sx={{ marginTop: 3 }}>
        <Button variant="contained" color="primary" onClick={handleSearch}>
          Ê§úÁ¥¢
        </Button>
      </Box>
    </Box>
  );
};

export default DMMSearch;
